const initialState = {

    items: [
        { name: "eggs" },
        { game: "asf" }
    ]
}





const citiesReducer = (state = 0, action) => {
    switch (action.type) {
        case "ADD":
            return state + 1
        case "DELETE":
            return state - 1;
        default:
            return state
    }

}
export default citiesReducer
